{"post_stream":{"posts":[{"id":3494862,"name":"Allen","username":"san4d","avatar_template":"/user_avatar/www.chiefdelphi.com/san4d/{size}/247132_2.png","created_at":"2025-01-28T17:36:39.830Z","cooked":"<h1><a name="p-3494862-problem-1" class="anchor" href="#p-3494862-problem-1"></a>Problem</h1>
<p>I’m trying to test a simple PathPlanner command that moves the robot forward 4m. While I see logs showing our drivetrain is running the command and that new target speeds are being produced, I don’t see the drivetrain’s position updating.</p>
<h1><a name="p-3494862-context-2" class="anchor" href="#p-3494862-context-2"></a>Context</h1>
<p>I’m a new mentor working on a team that’s growing its Java experience. We’re able to run the robot in auto mode but it follows a curved path, instead of a straight line. While I don’t see the curve when I run the simulation (Glass + PathPlanner telemetry), I do see the robot stop short of the 4m. To help structure the calibration, I’d like break things down into three problem areas:</p>
<ul>
<li>Pure software (ex. we’re not feeding the right subsystems the right information)</li>
<li>Pure hardware (ex. something is off with alignment or wiring)</li>
<li>Calibration, which I see as the point of integration.</li>
</ul>
<p>I see having a simple JUinit suite that we can runs simple paths (ex. straight line, back and forth, circle) and asserts an expected displacement tolerance as a useful way to find “pure software” bugs and see improvements in the calibration as we are able to bring the tolerances down.</p>
<p>I’d appreciate feedback on this approach/mindset.</p>
<h1><a name="p-3494862-code-3" class="anchor" href="#p-3494862-code-3"></a>Code</h1>
<p>You can checkout my POC in <a href="https://github.com/frc4087/SwerveDriveBase2025/pull/15" rel="noopener nofollow ugc">this branch</a>, but the basics are as follows:</p>
<pre data-code-wrap="java"><code class="lang-java">    @BeforeAll
    static void setupAll() {
        CommandScheduler.getInstance().enable();
        CommandScheduler.getInstance().printWatchdogEpochs();
        CommandScheduler.getInstance().run();

        DriverStationJNI.observeUserProgramStarting();
        drivetrain = new CommandSwerveDrivetrain(
            cfg,
            TunerConstants.DrivetrainConstants, 
            TunerConstants.FrontLeft, 
            TunerConstants.FrontRight, 
            TunerConstants.BackLeft, 
            TunerConstants.BackRight
        );
        auto = AutonomousControllerImpl.initialize(cfg, drivetrain);
    }

    @Test
    void testStraightPath() {
        var cmd = auto.getAuto("Config")
            .ignoringDisable(true)
            .finallyDo(() -&gt; System.out.println("END"));
        CommandScheduler.getInstance().schedule(cmd);
        await().atMost(10, TimeUnit.SECONDS).until(() -&gt; {
            CommandScheduler.getInstance().run();
            var runningCommand = drivetrain.getCurrentCommand();
            System.out.println(String.format("Test CMD: %s - %s - %s", CommandScheduler.getInstance().isScheduled(cmd), cmd.isScheduled(), cmd.isFinished()));
            if (runningCommand != null) {
                System.out.println(String.format("Running CMD: %s - %s - %s", runningCommand.getName(), runningCommand.getClass().getName(), runningCommand.isFinished()));
            }
            return false;
        });
    }
</code></pre>
<p>A few things I noticed based on the logs:</p>
<ul>
<li>The auto command is scheduled properly and run by the drivetrain</li>
<li><code>command.isFinished()</code> always returns false, but the <code>END</code> log in <code>finallyDo</code> prints</li>
<li>The drive appears to be in simulation mode, though I never explicitly set it</li>
<li>The command does run and I see logs that should the expected target velocity</li>
</ul>
